import React from "react";
import GenderCardStyle from "./GenderCardStyled";

const GenderCard = (props) =>
{

  if(props.gender.length > 0){
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            {props.gender[0].name} is  {props.gender[0].gender}!
          </h1>
          <h2>({props.gender[0].probability * 100}%)</h2>
        </div>
      </GenderCardStyle>
    )
  }else{
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            Loading Gender...
          </h1>
        </div>
      </GenderCardStyle>
    )
    }
  };

export default GenderCard;
